import{_ as r}from"./chunks/device-list-page-selection.WqqxafCI.js";import{_ as a,c as i,o,ag as l}from"./chunks/framework.BHpayLOB.js";const s="/assets/device-list-overview.BFWI3Uo3.jpg",n="/assets/device-performance-monitoring.D3bQKMzg.jpg",e="/assets/device-location-view.DDsQniFN.jpg",q=JSON.parse('{"title":"设备列表管理","description":"","frontmatter":{},"headers":[],"relativePath":"tutorials/device-management/device-list.md","filePath":"tutorials/device-management/device-list.md","lastUpdated":1752073241000}'),g={name:"tutorials/device-management/device-list.md"};function d(h,t,c,u,m,p){return o(),i("div",null,t[0]||(t[0]=[l('<h1 id="设备列表管理" tabindex="-1">设备列表管理 <a class="header-anchor" href="#设备列表管理" aria-label="Permalink to &quot;设备列表管理&quot;">​</a></h1><h2 id="设备列表概览" tabindex="-1">设备列表概览 <a class="header-anchor" href="#设备列表概览" aria-label="Permalink to &quot;设备列表概览&quot;">​</a></h2><p><img src="'+s+'" alt="设备列表概览"></p><h3 id="设备列表页面介绍" tabindex="-1">设备列表页面介绍 <a class="header-anchor" href="#设备列表页面介绍" aria-label="Permalink to &quot;设备列表页面介绍&quot;">​</a></h3><p>设备列表页面是 PandaTest 云真机测试平台的核心功能之一，为用户提供了直观的设备管理界面。在这个页面中，您可以：</p><ul><li><strong>查看所有可用设备</strong>：平台会展示所有已连接的移动设备，包括 Android 和 iOS 设备</li><li><strong>实时设备状态</strong>：每个设备卡片会显示设备的实时状态，包括在线/离线、电量、型号等信息</li><li><strong>快速筛选设备</strong>：通过顶部的筛选条件快速找到需要的设备</li><li><strong>一键连接设备</strong>：点击设备卡片即可快速连接到对应设备进行测试</li></ul><h3 id="设备信息展示" tabindex="-1">设备信息展示 <a class="header-anchor" href="#设备信息展示" aria-label="Permalink to &quot;设备信息展示&quot;">​</a></h3><p>每个设备卡片包含以下关键信息：</p><ul><li><strong>设备名称</strong>：设备的标识名称，便于识别</li><li><strong>设备品牌</strong>：显示设备制造商（如华为、小米、苹果等）</li><li><strong>系统版本</strong>：设备运行的操作系统版本</li><li><strong>设备状态</strong>：绿色圆点表示设备在线可用，红色表示离线</li><li><strong>电量显示</strong>：实时显示设备当前电量百分比</li><li><strong>连接状态</strong>：显示设备是否被占用或空闲</li></ul><h3 id="设备列表页面选择" tabindex="-1">设备列表页面选择 <a class="header-anchor" href="#设备列表页面选择" aria-label="Permalink to &quot;设备列表页面选择&quot;">​</a></h3><p><img src="'+r+'" alt="设备列表页面选择"></p><p>在设备列表页面，您可以：</p><ol><li><strong>浏览所有设备</strong>：滚动查看平台上所有可用的测试设备</li><li><strong>选择目标设备</strong>：根据测试需求选择合适的设备型号和系统版本</li><li><strong>查看设备详情</strong>：点击设备卡片查看更详细的设备信息</li><li><strong>快速连接</strong>：选择设备后快速建立连接开始测试</li></ol><h3 id="使用技巧" tabindex="-1">使用技巧 <a class="header-anchor" href="#使用技巧" aria-label="Permalink to &quot;使用技巧&quot;">​</a></h3><ul><li><strong>设备筛选</strong>：使用页面顶部的筛选功能快速定位需要的设备类型</li><li><strong>收藏常用设备</strong>：将经常使用的设备添加到收藏夹，方便快速访问</li><li><strong>设备状态监控</strong>：关注设备状态指示器，选择空闲状态的设备进行测试</li><li><strong>批量操作</strong>：选择多个设备进行批量测试任务</li></ul><h2 id="设备性能监控" tabindex="-1">设备性能监控 <a class="header-anchor" href="#设备性能监控" aria-label="Permalink to &quot;设备性能监控&quot;">​</a></h2><p><img src="'+n+'" alt="设备性能监控"></p><h3 id="性能监控功能" tabindex="-1">性能监控功能 <a class="header-anchor" href="#性能监控功能" aria-label="Permalink to &quot;性能监控功能&quot;">​</a></h3><p>设备性能监控页面帮助您：</p><ul><li><strong>实时性能数据</strong>：查看设备的 CPU、内存、网络等实时性能指标</li><li><strong>性能趋势分析</strong>：通过图表了解设备性能随时间的变化趋势</li><li><strong>资源使用监控</strong>：监控设备资源使用情况，确保测试环境稳定</li><li><strong>性能报告</strong>：生成详细的性能监控报告，用于测试结果分析</li></ul><h3 id="如何使用性能监控" tabindex="-1">如何使用性能监控 <a class="header-anchor" href="#如何使用性能监控" aria-label="Permalink to &quot;如何使用性能监控&quot;">​</a></h3><ol><li><strong>访问性能监控</strong>：在设备连接后，点击性能监控标签页</li><li><strong>选择监控指标</strong>：选择需要监控的性能指标（CPU、内存、网络等）</li><li><strong>设置监控时间</strong>：配置监控的时间间隔和持续时间</li><li><strong>查看实时数据</strong>：在图表中查看实时的性能数据变化</li><li><strong>导出报告</strong>：将性能监控数据导出为报告文件</li></ol><h2 id="设备位置视图" tabindex="-1">设备位置视图 <a class="header-anchor" href="#设备位置视图" aria-label="Permalink to &quot;设备位置视图&quot;">​</a></h2><p><img src="'+e+'" alt="设备位置视图"></p><h3 id="位置视图功能" tabindex="-1">位置视图功能 <a class="header-anchor" href="#位置视图功能" aria-label="Permalink to &quot;位置视图功能&quot;">​</a></h3><p>设备位置视图为您提供：</p><ul><li><strong>地理位置展示</strong>：在地图上直观显示设备的地理位置</li><li><strong>设备分布情况</strong>：了解测试设备在全球的分布情况</li><li><strong>就近选择设备</strong>：根据地理位置选择最近的设备，减少网络延迟</li><li><strong>位置信息管理</strong>：管理和更新设备的位置信息</li></ul><h3 id="使用位置视图" tabindex="-1">使用位置视图 <a class="header-anchor" href="#使用位置视图" aria-label="Permalink to &quot;使用位置视图&quot;">​</a></h3><ol><li><strong>查看设备分布</strong>：在地图上查看所有设备的地理分布</li><li><strong>选择就近设备</strong>：根据您的位置选择最近的设备进行测试</li><li><strong>位置筛选</strong>：按照地理位置筛选设备，提高测试效率</li><li><strong>网络优化</strong>：选择地理位置较近的设备，获得更好的网络连接质量</li></ol>',29)]))}const f=a(g,[["render",d]]);export{q as __pageData,f as default};
